    {"name": "CheeseBurger", "price": "30,000 so'm", "image": "data:image/jpeg;base64,"},
    {"name": "Maxi Pizza", "price": "45,000 so'm", "image": "data:image/jpeg;base64,"},
    {"name": "Tovuq Donar", "price": "28,000 so'm", "image": "data:image/jpeg;base64,"},
    {"name": "KFC Tovuq", "price": "32,000 so'm", "image": "data:image/jpeg;base64,"},
    {"name": "Hot Dog Classic", "price": "18,000 so'm", "image": "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS5NS49NOz4CaO7Zo41ybHUdyVxOxlpp62-Ww&s"},
    {"name": "MaxRoll Set", "price": "40,000 so'm", "image": "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRzR7YJpR90VCdvsz7yLZ5UUQpB8xtXyFiLbJzltT_33DxwrIx9-Q_NhPl5yXgMqUnNJms&usqp=CAU"},
